import React, { useState, useEffect } from 'react';
import Card from './Card';
import axios from 'axios';
import "./Display"

const ScienceFictionList = () => {
  const [scienceFictionItems, setScienceFictionItems] = useState([]);

  useEffect(() => {
    axios.get('https://child.onrender.com/api/sciencefiction')
      .then(response => {
        setScienceFictionItems(response.data.slice(0, 8)); 
      })
      .catch(error => {
        console.error('Error fetching data:', error);
      });
  }, []);

  return (
    <div id='DisplayMain'>
      {scienceFictionItems.map(item => (
        <Card 
          key={item._id} 
          title={item.Title} 
          image={item.Image[0]} 
          status={item.Status} 
        />
      ))}
    </div>
  );
}

export default ScienceFictionList;
